import { Form } from "react-bootstrap";
import "./SignUp.css";

const SignUp = () => {
  return (
    <Form>
      <Form.Control
        type="text"
        name="First Name"
        placeHolder="Please fill your first name"
        // ref={register({ required: "Required" })}
      />
    </Form>
  );
};
export default SignUp;
